import Buttons from "../elements/Buttons";
import DaysMowedPerWeek from "../inputs/DaysMowedPerWeek";
import Inputs from "../inputs/Inputs";

const Step3 = ({
  whichStep,
  setWhichStep,
  customerInputs,
  setPADDRegion,
  setCustomerInputs,
}) => {
  return (
    <div className="main container-inputs">
      <div className="coh-container text-main-container">
        <h2>Step3</h2>
        <ul className="inputs" id="inputs">
          <li className="column range">
            <DaysMowedPerWeek
              {...{
                customerInputs,
                setCustomerInputs,
                inStep: true,
                whichStep,
              }}
            />
          </li>
        </ul>
      </div>
      <Buttons {...{ whichStep, setWhichStep }} />
      <Inputs
        {...{
          whichStep,
          setWhichStep,
          setPADDRegion,
          customerInputs,
          setCustomerInputs,
        }}
      />
    </div>
  );
};

export default Step3;
